import logo from './logo.svg';
import Navbar from './components/Navbar';
import Home from './Home';
import Partners from './Partners';
// import AboutUs from './components/AboutUs';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="hero">
      <Navbar/>
      <Home />
      </div>
      <div className="partners">
        <Partners />
      </div>
      {/* <div className="about">
        <AboutUs />
      </div> */}
    </div>
  );
}

export default App;
